import styled from 'styled-components';
export const trHover = styled.tr`
    transition: 0.3s;
    &:hover {
        background-color: ${props => props.primary ? "palevioletred" : "white"};
        // rgb(250, 235, 215, 0.4);
        cursor: pointer;
    }
`
